message:
gh-1679 use real distance for certainty in Get{}

Do not recalculate. This means we don't have to read the vector anymore,
unless the user actually requests it.

Cross Encoder Ranker!

Started with cross-ranker-transformers using it in _additional like this:

_additional {
  crossrank(
    query: "What is Weaviate?"
    property: "text"
  ){
  score
  }
}

gh-653: extract all props except topOccurences{ value }

All other props have been one-dimensional, topOccurences also has
sub-fields, so they will be added in a seperate commit.

gh-602 get peer by name from network

This assumes that "name" is a way to uniquely identify a peer.
@bobvanluijt @laura-ham - Can I make this assumption?
